INSERT INTO `whitelist_applications` (`id`, `hex`, `name`, `answers`, `timestamp`, `status`, `admin_comment`, `processed_by`) VALUES
	(24, 'steam:11000010c692ef1', 'klicer', '{"Your IRL age":"11","Have you read our server rules? If so, where did you find them.":"gfbgjnf","What kind of character would you like to roleplay as?":"gjhfgfdjhghjfd","What are your character\'s strengths and weaknesses?":"gfhjdgfthjdfg","Someone is aiming at you with a gun, how does your character react?":"hhfgdfgh","You are selling drugs with your friend and a random person starts robbing you at gunpoint. What do you do?":"fhgtftdsgh"}', 1633873155, 1, 'mega hea', 'klicer'),
	(25, 'steam:110000117328a70', 'kuusement', '{"Your IRL age":"11","Have you read our server rules? If so, where did you find them.":"Lukesin kull","What kind of character would you like to roleplay as?":"kavadsen gansterid mänkida poppin inimesi tukkiga","What are your character\'s strengths and weaknesses?":"lasen h2sti ja nõrgus see et kiiresdi lähen n2rvi","Someone is aiming at you with a gun, how does your character react?":"olen gangster ei karta relva teen kohe /th ja vajutan H","You are selling drugs with your friend and a random person starts robbing you at gunpoint. What do you do?":"Joogsen maha ja annan kuuli"}', 1633873294, 1, 'pro', 'klicer'),
	(26, 'steam:110000105df0a3d', 'pein', '{"Sinu IRL vanus":"17","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Jah, Discordist","Millist karakterit sa sooviksid RP-da?":"Poolekohaga kriminaali.","Mis on sinu karakteri tugevused ja nõrkkused?":"Tugevused: suhteliselt rahulik, võtab elu vabalt, pädev autojuht Kappa. \\nNõrkused: Kipub pinge all närveerima.","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"Allun röövlile, sest kui ma taskust relva võtan, võib röövel mu siit maailmast ära eemaldada sekundiga.","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Kuna olukord on kaks ühe vastu, siis prooviksin kuidagi olukorrast välja nihverdada või röövli üle kavaldada (nt. kui röövel tegeleb minuga, siis läheb sõber natuke eemale ja hakkab röövlit selja tagant sihtima)."}', 1633877893, 1, 'tubli', 'klicer'),
	(27, 'steam:110000115bac701', 'KKasutaja', '{"Sinu IRL vanus":"15","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Jah, need olid https://eternalrp.me/profile lehel.","Millist karakterit sa sooviksid RP-da?":"Mina sooviksin mängida nii politseiniku karakterit kui ka kriminaalset karakterit vallutades kogu Los Santose.","Mis on sinu karakteri tugevused ja nõrkkused?":"Karakteri tugevused: olukordades võimalikult rahulik, saab kõigiga läbi; Nõrkused: Kardab kinniseid ruume, ei meeldi suured kiirused.","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"Minu karakter allub ja kuuletub sihtija käsklustele.","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Allun suvaka isiku käsklustele, sest ma kardan seda isikut ja ta tundub eriti vägev kriminaal olema."}', 1633878093, 1, 'hea töö', 'klicer'),
	(28, 'steam:11000014688d0ea', 'JonuJaanus KEYDROP', '{"Sinu IRL vanus":"16","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Jah olen ,leidsin need teie roleplay lehelt.","Millist karakterit sa sooviksid RP-da?":"Sooviksin rp-da vanemat isikut. Ei ole midagi kindlat kes tahaksin olla.","Mis on sinu karakteri tugevused ja nõrkused?":"Tugevus on see et olen igas ametis väga pädev saan kõigega hakkama ja nõrkused ausalt öeldes puuduvad :)","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"Pead alluma sellele isikule kes sind selle relvaga sihib ,muidu see on No Gun Fear.","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Sa pead alluma tollele isikule."}', 1633895797, 1, 'hea töö aga palun ära RP nii et su karakter on igat moodi perfektne :D', 'klicer'),
	(29, 'steam:110000111a7c0a7', 'Misasja', '{"Sinu IRL vanus":"13","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Klicer ise õpetas mulle reeglid selgeks","Millist karakterit sa sooviksid RP-da?":"Kriminaali kes pussitab ning varastab  rikstelt ning olen maffiast","Mis on sinu karakteri tugevused ja nõrkused?":"Tugevused on see et jõuan röövida ja peksta naisi jne kuid kullale ma jään nõrgaks nään kulda siis pean selle endale saama","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"Ütlen et jamab vale vennaga annan maffia nr ja lendan prg laivi ja tapan selle sitaka ära","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Ütlen et olen maffiast vend situb ennast täis\\n"}', 1633954359, 1, '#mafia #family', 'klicer'),
	(30, 'steam:110000148e844d0', 'EZlake', '{"Sinu IRL vanus":"12","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Jah need leiad avalehelt","Millist karakterit sa sooviksid RP-da?":"Sooviks rp-da head karakterit","Mis on sinu karakteri tugevused ja nõrkused?":"Tugevused on jooksmine ja tugevus ise nõrkused on valtetada kuna muidu läheb perse midagi.","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"alun tema käskudele, et päästa enda elu.","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Küsin mis su nimi on mida sa siit otsid ja kui hakkab tõsiselt võtma siisallun tema käskudele."}', 1634048414, 1, '', 'klicer'),
	(31, 'steam:110000147d50941', 'miid', '{"Sinu IRL vanus":"14","Kas sa oled lugenud meie serveri reegleid? Kui jah, kust sa leidsid need?":"Jah lugesin, discordist!","Millist karakterit sa sooviksid RP-da?":"Tavalist ja normaalset.","Mis on sinu karakteri tugevused ja nõrkused?":"Pole norkusi.","Keegi sihib sind relvaga, kuidas sinu karakter reageerib?":"Pogenen politsei jaoskonda!","Sa müüd sõbraga narkootikume, ja suvaline isik hakkab teid röövima relvaga. Mida teed?":"Pogeneme ara!"}', 1634050028, 1, 'super', 'klicer');
